contracts/GatekeeperOneHacker.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./GatekeeperOne.sol";

contract GatekeeperOneHacker {
    GatekeeperOne gatekeeper;
    constructor(address _gatekeeper) {
        gatekeeper = GatekeeperOne(_gatekeeper);
    }

    // Tries a range of gas values and returns the first gas amount that worked (or 0 if none)
    function bruteForceEnter(uint256 gasAmt) public returns (uint256) {
        // const base = 8191;
        // for (uint256 gasAmt = startGas; gasAmt <= endGas; gasAmt++) {
            // uint256 finalGasAmount = gasAmount + 
            (bool success, bytes memory returndata) = address(gatekeeper).call{gas: gasAmt}(abi.encodeWithSignature("gateTwoFn()"));
            if (success) {
                return gasAmt;  // Found gas amount that passed gateTwo
            }
            if (!success) {
            if (returndata.length > 0) {
                // Bubble up revert reason from returndata
                assembly {
                    let returndata_size := mload(returndata)
                    revert(add(32, returndata), returndata_size)
                }
            } else {
                revert("Call failed without revert reason");
            }
}
        // }
        require(false, "No success in range");
        return 0;
    }


}

contracts/GatekeeperOne.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract GatekeeperOne {
    address public entrant;
    uint256 public gasRemaining;

    modifier gateOne() {
        require(msg.sender != tx.origin, "failed gate 1");
        _;
    }

    modifier gateTwo() {
        gasRemaining = gasleft();
        require(gasleft() % 8191 == 0, "failed gate 2");
        _;
    }

    function gateTwoFn() public gateOne returns (bool) {
        // return true;
        gasRemaining = gasleft();
        // require(gasleft() % 8191 == 0, "failed gate 2");
        return gasleft() % 8191 == 0;
    }



    modifier gateThree(bytes8 _gateKey) {
        require(uint32(uint64(_gateKey)) == uint16(uint64(_gateKey)), "GatekeeperOne: invalid gateThree part one");
        require(uint32(uint64(_gateKey)) != uint64(_gateKey), "GatekeeperOne: invalid gateThree part two");
        require(uint32(uint64(_gateKey)) == uint16(uint160(tx.origin)), "GatekeeperOne: invalid gateThree part three");
        _;
    }

    function enter() public gateOne gateTwo returns (bool) {
        entrant = tx.origin;
        return true;
    }
}

